import React from "react";
import Menu from "semantic-ui-react/src/collections/Menu";


const Filter = ({filterBy, setFilter}) => {
    <Menu secondary>
        <Menu.Item name='all' active={filterBy === 'all'} onClick={setFilter.bind(this, 'all')}>Все</Menu.Item>
        <Menu.Item name='priceHigh' active={filterBy === 'priceHigh'} onClick={setFilter.bind(this, 'priceHigh')}>Цена
            Дорогие</Menu.Item>
        <Menu.Item name='priceLow' active={filterBy === 'priceLow'} onClick={setFilter.bind(this, 'priceLow')}>Цена
            Дешевые</Menu.Item>
        <Menu.Item name='model' active={filterBy === 'model'} onClick={setFilter.bind(this, 'model')}>По моделям</Menu.Item>
    </Menu>
};
export default Filter
